  input  [5:0]  iEntry0_tag,
  input  [31:0] iEntry0_data,
  input         iEntry1_valid,
  input  [5:0]  iEntry1_tag,
  input  [31:0] iEntry1_data,
  output        oEntry0_valid,
  output [5:0]  oEntry0_tag,
  output [31:0] oEntry0_data,
  output        oEntry1_valid,
  output [5:0]  oEntry1_tag,
  output [31:0] oEntry1_data
);

