  assign oEntry0_valid = swap ? iEntry1_valid : iEntry0_valid;
  assign oEntry0_tag = swap ? iEntry1_tag : iEntry0_tag;
  assign oEntry0_data = swap ? iEntry1_data : iEntry0_data;
  assign oEntry1_valid = swap ? iEntry0_valid : iEntry1_valid;
  assign oEntry1_tag = swap ? iEntry0_tag : iEntry1_tag;
  assign oEntry1_data = swap ? iEntry0_data : iEntry1_data;
endmodule

